    e.preventDefault();
    setLike(like + 1);
    if ((like = 13)) {
      return;
    }
  };
  return (
    <div className={css.container}>
      <h3>Task 4</h3>
      <div className={css.card}>
        <div onClick={handleLike} className={css.like}>
          {like}
        </div>
        <div className={css.dislike}>{dislike}</div>
      </div>
    </div>
  );
}

